The Gratitude I Feel To Be In The Company Of My Tribe Is Unexplainable. 👉🏾

@arellhughes - My Mother Has Shaped Me, Taught Me, Cared For Me & To Her I Will Always Give Praises. BUT To See The Business Woman She Has Transformed Into Is Beyond Inspirational. 

@michelsproles - To See The Hard Work & Dedication That You Give Selflessly To Your Non Profit @westcoastelitetrackclub HATS OFF TO YOU!!! Not To Mention The Records Your Setting As A Track Club & Coach, GIRL I SEE YOU!!

@aprilroomet - Being An Example Of A Hard Working Single Mom, Fighting Stereotypes, While MaintainingA Strong Voice & BEING ONE OF THE DOPEST STYLIST IN THE GAME!!!! How Do You Do It!?? I SEE YOU!!!

@shesofly - If A Magic Wand Was A Person, EVERYTHING You Touch Turns To Gold With Style & Grace! One Of The Hardest Working, Innovative, Get It Done Having, Once Your Mind Is Made Up It’s GO!!!! I’m Trying To Keep Up GIRL I SEE YOUUUU! The Brand, The Brains, The Beauty! 

@thedw - The Person I Call To Get Me Straight, She Leads, She Is The One Of Us That Are In Those Rooms Making Moves & Just So Poise & Always Under Control. She Has Given Me So Much Game Just By Leading, I’m Always Grateful To Call You My OG, I BEEN SEEN YOU GIRL!!!

@aboveallrise When You Step In The Place We Know You Mean Business!! You Get It Done & I’ve Learned How To  Deal With Many Tough Situations By Watching You Navigate First Hand. so Much Respect For You, I SEE YOU!!

@adrisdebarge The Best Mom, Great Wife, Most Compassionate Friend, Woman of God & All Around Great Human. Your Attention To Detail & Ability To Teach Has Gotten Me Out Of Some Tough Situations, So Proud Of You & I See The Woman That You Are & I Love It!!!

@brittneyymendoza GIRL, I SEE YOU! Juggling A Flourishing Business, Twins, & Managing Your Team. I’ve Seen You Grow Into A Straight Boss Over The Past Few Years & I’m So Proud of You!!!

@neicybaby Just A Creative Genius, From Directing, To Grooming, To Glamming, Your Spirit Is A Whole Vibe. You Always Have My Back, You Stay Covering Everyone & I SEE YOU & YOU Are About To Take Over!!!

Just Wanted To Give Them Their Flowers Aloud!!! This Event Was Too Much Fun!!!

#IHaveBeenSeen #GirlISeeYou

Yesterday I was invited to preview and attend @thepregoexpo & it was so cute and I had such a good time meeting and educating my self all these cool baby brands! 

Now that I will have 3 under 3 all the new products coming out are so innovative and it’s always good from a personal and business perspective to get to know what’s new in the market.

@theaagroup represents lots of women and mommies so again always good to attend, learn, and connect! Thanks @thepregoexpo for inviting me out it was lots of fun!!
